import React from 'react';
import styled from 'styled-components';
import QuickToolsPanel from '../components/NewAttraction/QuickToolsPanel'

const Border = styled.div`
  border-top: solid 2px;
  border-right: solid 2px;
  height: 720px;
  width: 89%;
  padding: 0;
  overflow: hidden;
`;

const Column = styled.div`
  font-size: 20.89px;
  font-family: "Lucida Console", monospace;
  border-right: solid 2px;
  height: 100%;
  width: 50%;
  padding: 5px;
`;
const Menu = styled.div`
  display: flex;
  align-items: center;
  background-color: lightgray;
  height: 60px;
  width: 100%;
  border-bottom: solid 2px;
`;

const Title = styled.div`
   height: 60px;
   font-size: 1.5em;
   font-family: "Lucida Console", monospace;
   display: flex;
   align-items: center;
   margin-top: 5px;
   margin-bottom: -5px;
   padding: 1%;
`;

const Row = styled.nav`
  font-size: 16px;
  font-family: Georgia, 'Times New Roman', Times, serif;
  border-bottom: 2px solid black;
  border-left: 2px solid black;
  border-right: 2px solid black;
  display: flex;
  background-color: aliceblue;
  margin: -2px -7px;
  height: 100%;
  align-items: center;
  justify-content: center;
`;

 export const nbsp = '\u00A0';
 export const breakline = '\u000A';
const newAttraction = () => {
    return (
        <>
        <QuickToolsPanel/>
        <Title>
          Attraction Manager
          </Title>
          <Border>
            <Menu>

            <Column>
              Ride Name
              <Row> The Joker </Row>
            </Column>

            <Column>
              Daily Opening
              <Row> Park Open </Row>
            </Column>

            <Column>
              Daily Closing
              <Row> Park Close </Row>
            </Column>

            <Column>
              Theoretical Capacity
              <Row> 720 </Row>
            </Column>

            <Column>
              Target Capacity
              <Row> 612 </Row>
            </Column>

            <Column>
              Min Vehicles
             <Row> 3 </Row>
            </Column>

            <Column>
              Max Vehicles
              <Row> 5 </Row>
            </Column>

            <Column>
              Max {nbsp} Seats
              <Row> 40 </Row>
            </Column>

            <Column>
              Min {nbsp} Staff
              <Row> 4 </Row>
            </Column>

            <Column>
              Max {nbsp} Staff
              <Row> 7 </Row>
            </Column>

            <Column>
              Park Section
              <Row> 250 </Row>
            </Column>

            <Column>
              Weather Code
              <Row> Alpha </Row>
            </Column>

            <Column>
            Type {nbsp} {nbsp}
              <Row> Ride </Row>
            </Column>
            </Menu>
          </Border>
        </>
      );
    };

    export default newAttraction
